script: |
  super -f text -I q289.spq | sort > q289.out

inputs:
  - name: q289.spq
    data: |
      SELECT DISTINCT - 16 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet), tab2 (FORMAT parquet) cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q289.out
    data: |
      -16
